        private readonly int TSIZE_XOR = TABLE_XOR.Count;
        private readonly int TSIZE_MIX = TABLE_MIX.Count;

        //=====================================================================
        // HASH STATE
        //=====================================================================

        /*hash buffer*/
        private readonly byte[] m_digest = new byte[HASH_LEN];

        /*row index*/
        private int m_rnd = 0;

        //=====================================================================
        // STATE
        //=====================================================================

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public void Update(byte input)
        {
            IReadOnlyList<byte> xor = TABLE_XOR[input];
            IReadOnlyList<byte> mix = TABLE_MIX[m_rnd];
            byte temp;
            for (int i = 0; i < HASH_LEN; ++i)
            {
                temp = m_digest[mix[i]];
                m_digest[mix[i]] = m_digest[i];
                m_digest[i] = (byte)(temp ^ xor[i]);
            }
            m_rnd = (m_rnd + 1) % TSIZE_MIX;
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public void Update(IEnumerable<byte> input)
        {
            foreach (byte b in input)
            {
                Update(b);
            }
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public void Update(IReadOnlyList<byte> input, int length)
        {
            for (int i = 0; i < length; ++i)
            {
                Update(input[i]);
            }
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public void Update(IReadOnlyList<byte> input, int offset, int length)
        {
            int limit = offset + length;
            for (int i = offset; i < limit; ++i)
            {
                Update(input[i]);
            }
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public void Update(Stream input)
        {
            int b;
            while((b = input.ReadByte()) >= 0)
            {
                Update((byte)b);
            }
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public IReadOnlyList<byte> Finalize()
        {
            byte[] output = new byte[HASH_LEN];
            IReadOnlyList<byte> xor = TABLE_XOR[TSIZE_XOR-1];
            for (int i = 0; i < HASH_LEN; ++i)
            {
                output[i] = (byte)(m_digest[i] ^ xor[i]);
            }
            return output;
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public void Reset()
        {
            Array.Clear(m_digest, 0, m_digest.Length);
            m_rnd = 0;
        }

        public static void GetVersion(out ushort major, out ushort minor, out ushort patch)
        {
            major = VERSION_MAJOR;
            minor = VERSION_MINOR;
            patch = VERSION_PATCH;
        }
